import React from 'react';
import Common from './Components/Common';

function Home() {
  return (
    <>
     <Common 
      name="Grow your skill with " 
      imgsrc={web} 
      visit="/Service" 
      btname="Get Entroll" />
    </>
  );
}

export default Home;
